import React from 'react';
import {
  BrowserRouter as Router,
  Route,
} from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <InfoPage>
            <Route path="/name" />
        </InfoPage>
      </Router>
    </div>
  );
}

export default App;
